import React from "react";
import { useState } from "react";
import '../css/user_account.css';
import { useEffect } from "react";
import { useNavigate } from "react-router-dom";

function Accountpage(){
    const [user, setUser] = useState(null);
    const navigate = useNavigate();
  
    useEffect(() => {
      const userStr = localStorage.getItem('user');
      if (userStr) {
        setUser(JSON.parse(userStr));
      }
    }, []);
  
    const handleLogout = () => {
      localStorage.removeItem('user');
      setUser(null);
      navigate('/Phptest');
    };
    return(
        <>  

  <div className="test">
    <div className="wrapper" id="myaccount">
        <main>
        <section class="profilepicture">
            <img src="https://pbs.twimg.com/profile_banners/3289201891/1592532582/1500x500" alt="Banner" width="680" height="220" class="account-banner"/>
            <div class="profile-pic-container">
            <img src="https://pbs.twimg.com/profile_images/1561978310392963072/syAgJht9_400x400.jpg" alt="Profile Picture" width="135" height="135" class="account-profile-picture"/>
            </div>
        </section>
        <section class="profile-details">
            <nav>
            <div class="icon-frame frame-cover">
                <img src="https://assets.codepen.io/9277864/menu-more.svg" alt="More Button" width="15" height="15" class="icon" />
            </div>
            <div class="icon-frame frame-cover">
                <img src="https://assets.codepen.io/9277864/envelope.svg" alt="Send Message Button" width="16" height="16" class="icon" />
            </div>
            {/* <button class="profile-botton">
                <a href="https://twitter.com/intent/follow?screen_name=TanGravam" target="_top">Follow</a>
            </button> */}
            </nav>
            <div class="profile-info">
            <h1> {user?.first_name}   <img src="https://assets.codepen.io/9277864/badge-verified.svg" alt="Verified Badge" width="18" height="18" class="verified-badge" /></h1>
            <small>@{user?.last_name}</small>

            <div class="account-info">
                <p> {user?.user_bio}</p>
                <div class="info-container-1">
                <p><img src="https://assets.codepen.io/9277864/pin-1.svg" alt="Location Icon" width="16" height="16" class="info-icon" /> <span class="location"></span><span>Localisation</span></p>
                <p><img src="https://assets.codepen.io/9277864/hyperlink-2.svg" alt="Hyperlink Icon" width="16" height="16" class="info-icon" /> <span class="web-site"><a href="" target="_top">website.com</a></span></p>
                <p><img src="https://assets.codepen.io/9277864/calendar-3.svg" alt="Calendar Icon" width="16" height="16" class="info-icon" /> <span>Joined 'date'</span></p>
                </div>
                <div class="info-follow">
                <p><strong>'0'</strong> <span>Following</span></p>
                <p><strong>'0'</strong> <span>Followers</span></p>
                </div>
            </div>
            </div>
        </section>
        <section class="section-tweets">
            <ul class="tweets-nav">
                
            </ul>
        </section>
        </main>
    </div>
  </div>



        </>
    )
}

export default Accountpage;
